import React from 'react';
import { Routes, Route, Link, NavLink, useNavigate, BrowserRouter as Router } from 'react-router-dom';
import './App.css';

function App() {

  return (
    <div>
      <Nav/>
      <Routes>
        <Route path="/*" element={<App/>}/>
        <Route path="/people" element={<People/>} />
        <Route path="/planet" element={<Planets/>}/>
        <Route path="/film" element={<Films/>}/>
      </Routes>
    </div>
  );
}

function People(){
  return(
      <div>
          <h1>Hi People</h1>
      </div>   
  );
}
function Planets(){
  return(
      <div>
          <h1>Hi Planets</h1>
      </div>
  );
}
function Films(){
  return(
      <div>
          <h1>Hi Film</h1>
      </div>
  );
}
function Nav(){
  return(
    <nav>
      <Link><li>Star Wars Home</li></Link>
      <link><li>People</li></link>
      <link><li>Film</li></link>
      <link><li>Planets</li></link>
    </nav>
  );

}

export default App;
